import React from "react";

export default function WeatherIcon() {
    return (
    <div className="temp">
    <div className="row">
      <div className="col-12">
        <div id="main-icon">
          <img
            id="main-icon-image"
            src="images/SUPER_CLOUD.png"
            alt=""
          />
        </div>
      </div>
    </div>
    </div>
    );

}
